    "valentine-national-wildlife-refuge-period-september-1-to-december-31-1942-narrative-report",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Valentine NWR
    outlines Refuge accomplishments from September through December of 1942. The report
    begins by summarizing the weather conditions and water conditions during this period.
    Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
    raptors, and fish- is also covered. The Refuge development and maintenance section
    discusses physical developments, plantings, and collections and receipts. Resource
    management is outlined; topics include grazing, haying, fur harvesting, and timber
    removal. The public relations section of the report describes Refuge visitors and
    Refuge participation. N-R forms are attached.",nt"license_title": "License
